import React, {Component} from 'react';
import SearchBar from '../components/search/SearchBar'
import { Row, Col } from 'react-bootstrap';
import NavBar from "../components/navbar/AppNavBar";
import {UserInfo} from "../components/profilepage/userinfo/UserInfo";
import * as config from "../config.json";
import {search} from '../components/search/util';
import Gallery from 'react-grid-gallery';
import './Home.css';
import {HomeSearchBar} from "../components/home/homesearchbar/HomeSearchBar";
import {HomeGallery} from "../components/home/homegallery/HomeGallery";

class Home extends Component {

    constructor(props) {
        super(props);
    }

    componentDidMount() {
        document.body.style.overflowY = 'hidden';
        document.querySelectorAll('.ReactGridGallery_tile').forEach((tile, i) => {
            if (i % 2 === 0)
                tile.style.transform = 'scaleX(1) scaleY(1) scaleZ(1) rotateX(-3deg) rotateY(-34deg) rotateZ(16deg) translateX(0px) translateY(0px) translateZ(0px) skewX(-14deg) skewY(-7deg)';
            else
                tile.style.transform = 'scaleX(1) scaleY(1) scaleZ(1) rotateX(-3deg) rotateY(-34deg) rotateZ(16deg) translateX(0px) translateY(20px) translateZ(0px) skewX(-14deg) skewY(-7deg)';
        });
    }

    componentWillUnmount() {
        document.body.style.overflowY = 'auto';
    }

    render() {
    return (
    <>
        <NavBar showLogin position='fixed'/>
        <HomeGallery />
        <HomeSearchBar />
    </>
    )
  }
}

export default Home;
